import style from './users.module.css'
import React from "react";

const Users = (props) => {
    let state = props.usersPage

    const setUsers = () => {
        props.setUsers([
            {id: 1, avatar: 'data:image/jpeg;base64,',
                name: 'Jenya', bio: 'some text', location: 'Ukraine', follow: false },
            {id: 2, avatar: 'data:image/jpeg;base64,',
                name: 'Juliya', bio: 'some text', location: 'Ukraine', follow: true },
            {id: 3, avatar: 'https://static.espreso.tv/uploads/photobank/228000_229000/228071_privid_300x170_0.png', name: 'Egor', bio: 'some text', location: 'Ukraine', follow: false },
            {id: 4, avatar: 'data:image/jpeg;base64,',
                name: 'Vitalik', bio: 'some text', location: 'Ukraine', follow: true }])
    }

    return (
        <div className={style.inform}>
            {
            state.usersData.map(users => <div key={users.id}>
            <span>
                <div className={style.ava}><img src={users.avatar}/></div>
                {users.follow
                    ? <button onClick={() => {props.setUnfollow(users.id)}}> Unfollow </button>
                    : <button onClick={() => {props.setFollow(users.id)}}> Follow </button>}
            </span>
                <span>
                <span>
                <div>{users.name} </div>
                <div>{users.bio}</div>
                    </span>
                <span>
                    <div>{users.location}</div>
                </span>
            </span>
            </div>
            )
            }
            <div>
                <button onClick={setUsers}>Show More</button>
            </div>
        </div>
    )

}
export default Users